# upload to metadata and steal the hex
part_1 = bytes.fromhex("")

with open('frog.png', 'rb') as f:
    frog = f.read()[:-12-32]

frog = frog[frog.index(b"IDAT")+4:]
headerstuffs = bytes.fromhex("ffd8ffe000104a46494600010100000100010000") # common jpeg header.

jpeg = headerstuffs + part_1 + frog

with open('frog.jpg', 'wb') as f:
    f.write(jpeg)

# transcribe the image
print(bytes.fromhex("616d6174657572734354467b6a7065675f7472616e73706c616e745f316662346361337d"))